    return(
<div style={{marginTop:50,display:'flex',marginLeft:'40%'}}>
    <div style={{marginRight:'30'}}>
    <text style={{fontSize:30,fontWeight:'bold'}}>Beh Kala</text>
    </div>
    
     <input type="text" className="input" placeholder="جستجوی محصولات"/> 

<div className="icon">
<IconContext.Provider

      value={{ color: '#F79F1F', size: '30px'}}>
 <GoSearch /> 
    </IconContext.Provider>
</div>


   
   
 
     </div>
    )
}
 export default Searchbar;
